import React from 'react';
import { Link } from 'react-router-dom';
import '../Auth/auth.css'; // Reusing auth styles
import './landing.css'; // New styles for background animation

const Landing = () => {
    return (
        <div className="landing-container">
            {/* Navbar */}
            <nav className="navbar">
                <div className="website-name">Expense Tracker</div>
                <div className="auth-links">
                    <Link to="/login" className="auth-button">Login</Link>
                    <Link to="/register" className="auth-button">Sign Up</Link>
                </div>
            </nav>

            {/* Animated Background */}
            <div className="animated-bg">
                <div className="auth-content">
                    <h1>Welcome to Expense Tracker</h1>
                    <p>Save more, stress less. Start tracking today!</p>
                </div>
            </div>
        </div>
    );
}

export default Landing;
